// v0.1 Script to make a feature show lines above their head. - By Fayelure

// ------------------------OPTIONS-----------------------------------------------------
//Feel free to add liines
let textMonologue =["I like you", "MEOW MEOW"]

// Feel free to change the time between each lines
let timeBetweenLinesSaid = 2000 // in milliseconds


// -----------------------------------------------------------------------------
// Create GUI
let gui  = feature.createBasicGui()

// Add our first control:
let textControl =gui.addText(textMonologue[0])
// Call the GUI to show.
gui.show()


// loop through the text monologue lines
let k=0
setInterval(()=>{
  textControl.text = textMonologue[k]
  textControl.update()
  k++
  if(k>textMonologue.length-1){
    k=0
  }
},timeBetweenLinesSaid)
